import React, {useContext} from 'react'
import '../Pages/CSS/Knives.css'
import { KnifeContext } from '../Context/KnifeContext'
import  Item from '../Components/Knife/Knife'

export const Knives = (prop) => {
  const {all_knives} = useContext(KnifeContext)
  return (
    <div className='knives'>
        <div className="indexsort">
          <p>
            <span>Showing 1-32 </span> out of 100 products
          </p>
          <div className="products">
            {all_knives && all_knives.map((item, i)=>{
              if(props.category === item.category){
                return <Item key={i} id={item.id} name={item.name} image={item.image} price={item.knife_price}/>
              }
              else {
                return null;
              }
            })}
          </div>
        </div>
    </div>
  )
}
export default Knives
